import logo from './logo.svg';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import Header from './components/navbar';

function App() {
  return (
    <Routes>
      <Route path="/" element={Header}></Route>
    </Routes>
  );
}

export default App;
